import './App.css';

import Axios from 'axios'

import React,{useState,useEffect} from 'react';


function App() {

  const [scraps,setScraps]=useState([])

  useEffect(() => {

    fetchScraps();

  }, [])

  useEffect(() => {

    console.log(scraps)

  }, [scraps])

  const fetchScraps=async()=>{

    const response=await Axios('http://localhost:8000/');

    setScraps(response.data)    

  }

  return (

    <div className="App">

      {

        scraps && scraps.map(scrap=>{

          return(
           <div>
             <div>
             <select class="form-select" aria-label="Default select example">
             <option selected>Open this select menu</option>
             <option value="1">One</option>
             <option value="2">Two</option>
             <option value="3">Three</option>
             </select>
             </div>
            <div key={scrap._id} style={{alignItems:'center',margin:'20px 60px'}}>
            <h1>{scrap.pdf_name}</h1>
            <h4><a href={scrap.pdf_link}>{scrap.pdf_link}</a></h4>

            <p>{scrap.company_code}</p>

          </div>
          </div>

          )


        })

      }

    </div>

  );

}


export default App;
